import './App.css';
import React from "react";

function App(){
  const menu = ['Watches', 'Bags & Luggage', 'Sunglasses', 'Jewelry', 'Wallets']
  return(
    <div>
      <h1>Accessories</h1>
      {menu.map((accessory)=>(
        <h3>{accessory}</h3>
      ))}
    </div>
  )
}

export default App;
